import json
from datetime import datetime
from enum import Enum
from typing import List, Dict, Optional
import uuid

class SubmissionType(Enum):
    FABS = "FABS"
    DABS = "DABS"

class PublishStatus(Enum):
    DRAFT = "DRAFT"
    VALIDATED = "VALIDATED"
    PUBLISHED = "PUBLISHED"
    FAILED = "FAILED"

class ErrorSeverity(Enum):
    WARNING = "WARNING"
    ERROR = "ERROR"
    CRITICAL = "CRITICAL"

class Error:
    def __init__(self, error_id: str, message: str, severity: ErrorSeverity, details: Optional[Dict] = None):
        self.error_id = error_id
        self.message = message
        self.severity = severity
        self.details = details or {}

    def to_dict(self):
        return {
            "error_id": self.error_id,
            "message": self.message,
            "severity": self.severity.value,
            "details": self.details
        }

class Submission:
    def __init__(self, submission_id: str, submission_type: SubmissionType, agency: str, created_by: str):
        self.submission_id = submission_id
        self.submission_type = submission_type
        self.agency = agency
        self.created_by = created_by
        self.created_at = datetime.now()
        self.updated_at = self.created_at
        self.publish_status = PublishStatus.DRAFT
        self.errors: List[Error] = []

    def add_error(self, error: Error):
        self.errors.append(error)
        self.updated_at = datetime.now()

    def update_publish_status(self, status: PublishStatus):
        self.publish_status = status
        self.updated_at = datetime.now()

    def validate(self):
        if self.submission_type == SubmissionType.FABS:
            self._validate_fabs()
        elif self.submission_type == SubmissionType.DABS:
            self._validate_dabs()

    def _validate_fabs(self):
        self.errors = []
        if not self.agency:
            self.add_error(Error(str(uuid.uuid4()), "Agency is required for FABS submission.", ErrorSeverity.ERROR))
        self.update_publish_status(PublishStatus.VALIDATED if not self.errors else PublishStatus.FAILED)

    def _validate_dabs(self):
        self.errors = []
        if not self.agency:
            self.add_error(Error(str(uuid.uuid4()), "Agency is required for DABS submission.", ErrorSeverity.ERROR))
        self.update_publish_status(PublishStatus.VALIDATED if not self.errors else PublishStatus.FAILED)

    def to_dict(self):
        return {
            "submission_id": self.submission_id,
            "submission_type": self.submission_type.value,
            "agency": self.agency,
            "created_by": self.created_by,
            "created_at": self.created_at.isoformat(),
            "updated_at": self.updated_at.isoformat(),
            "publish_status": self.publish_status.value,
            "errors": [error.to_dict() for error in self.errors]
        }

class Agency:
    def __init__(self, agency_id: str, name: str):
        self.agency_id = agency_id
        self.name = name
        self.created_at = datetime.now()

    def to_dict(self):
        return {
            "agency_id": self.agency_id,
            "name": self.name,
            "created_at": self.created_at.isoformat()
        }

class BrokerSystem:
    def __init__(self):
        self.submissions: Dict[str, Submission] = {}
        self.agencies: Dict[str, Agency] = {}

    def create_submission(self, submission_type: SubmissionType, agency: str, created_by: str) -> Submission:
        submission_id = str(uuid.uuid4())
        submission = Submission(submission_id, submission_type, agency, created_by)
        self.submissions[submission_id] = submission
        return submission

    def get_submission(self, submission_id: str) -> Optional[Submission]:
        return self.submissions.get(submission_id)

    def update_submission_status(self, submission_id: str, status: PublishStatus) -> bool:
        submission = self.get_submission(submission_id)
        if submission:
            submission.update_publish_status(status)
            return True
        return False

    def delete_submission(self, submission_id: str) -> bool:
        if submission_id in self.submissions:
            del self.submissions[submission_id]
            return True
        return False

    def create_agency(self, name: str) -> Agency:
        agency_id = str(uuid.uuid4())
        agency = Agency(agency_id, name)
        self.agencies[agency_id] = agency
        return agency

    def publish_submission(self, submission_id: str) -> bool:
        submission = self.get_submission(submission_id)
        if submission and submission.publish_status == PublishStatus.VALIDATED:
            submission.update_publish_status(PublishStatus.PUBLISHED)
            return True
        return False

