def main():
    broker = BrokerSystem()
    agency = broker.create_agency("Department of Transportation")
    submission = broker.create_submission(SubmissionType.FABS, agency.name, "user123")
    submission.validate()
    broker.publish_submission(submission.submission_id)
    print(json.dumps(submission.to_dict(), indent=2))

if __name__ == "__main__":
    main()
